import { Component } from '@angular/core';
import { Bookmark } from '../Models/bookmark.interface';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  bookmarks: Bookmark[] = [{ id: 1, name: 'test', category: 'string', language: 'test', dateAdded: new Date() }, { id: 1, name: 'test2', category: 'string2', language: 'test2', dateAdded: new Date() }];
}
